  "text" : "\uADF8\uB9AC\uACE0 \uC2E4\uC9C8\uC801\uC778 \uC0AC\uD615\uD3D0\uC9C0\uAD6D\uC778 \uD55C\uAD6D\uC5D0\uC11C \uAC00\uC7A5 \uAC15\uB825\uD55C \uCC98\uBC8C\uC740 \uBB34\uAE30\uC9D5\uC5ED\uC774 \uC544\uB2C8\uB77C \uC0AC\uD615\uC785\uB2C8\uB2E4. \uC2E4\uC9C8\uC801 \uC0AC\uD615\uD3D0\uC9C0\uAD6D\uC774\uB77C \uD568\uC740 \uC0AC\uD615\uC81C\uB3C4\uB294 \uC874\uC18D\uD558\uACE0 \uC788\uC9C0\uB9CC \uC9D1\uD589\uC744 \uD558\uACE0 \uC788\uC9C0 \uC54A\uC740 \uAD6D\uAC00\uB77C\uB294 \uB73B\uC774\uACE0, \uC694\uC998\uC5D0\uB3C4 \uBC95\uC815\uCD5C\uACE0\uD615\uC778 \uC0AC\uD615\uC740 \uC120\uACE0\uD574\uC694. \uB2E4\uB9CC \uC9D1\uD589\uC744 \uC548 \uD560 \uBFD0\uC774\uC9C0.",
