  "text" : "\uD559\uBD80\uC640 \uB300\uD559\uC6D0\uC774 \uB2E4\uB978 \uD559\uAD50\uC778 \uACBD\uC6B0\uC5D0\uB294 \uB17C\uBB38\uC9C0\uB3C4\uB97C \uBC1B\uACE0 \uC2F6\uC740 \uAD50\uC218\uC758 \uD3C9\uD310\uC744 \uC218\uC9D1\uD558\uAE30\uAC00 \uC0C1\uB300\uC801\uC73C\uB85C \uC5B4\uB835\uACA0\uC9C0\uB9CC \uADF8\uB798\uB3C4 \uD560 \uC0AC\uB78C\uC740 \uB2E4 \uD558\uACE0 \uB4E4\uC5B4\uAC00\uACE0, \uD559\uBD80\uC640 \uB300\uD559\uC6D0\uC774 \uAC19\uC740 \uD559\uAD50\uB77C\uBA74 \uD559\uBD80 \uB54C \uAD50\uC218\uC758 \uC6EC\uB9CC\uD55C \uD3C9\uD310\uACFC \uC815\uBCF4\uB294 \uBBF8\uB9AC \uC54C\uACE0 \uB300\uD559\uC6D0\uC73C\uB85C \uB4E4\uC5B4\uAC00\uAC8C \uB418\uB294\uC9C0\uB77C\u2026",
