    "text" : "\uB3C4\uB451\uC774 \uB4E4\uC5C8\uB2E4\uB294 \uAC83\uC744 \uC9C1\uAC10\uD55C \uCD5C\uC528\uB294 \uAE40\uC528\uB97C \uC8FC\uBA39\uC73C\uB85C \uC218\uCC28\uB840 \uB54C\uB824 \uB118\uC5B4\uB728\uB9AC\uACE0,\uAE40\uC528\uAC00 \uB3C4\uB9DD\uAC00\uB824\uD558\uC790 \uADF8\uC758 \uB4A4\uD1B5\uC218\uB97C \uBC1C\uB85C \uC5EC\uB7EC\uCC28\uB840 \uCC3C\uB2E4.\uCD5C\uC528\uC758 \uD3ED\uD589\uC740 \uC5EC\uAE30\uC11C \uB05D\uB098\uC9C0 \uC54A\uC558\uB2E4.\uC8FC\uC704\uC5D0 \uC788\uB358 \uBE68\uB798 \uAC74\uC870\uB300\uC640 \uD5C8\uB9AC\uC5D0 \uCC28\uACE0 \uC788\uB294 \uBCA8\uD2B8\uAE4C\uC9C0 \uD480\uC5B4 \uAE40\uC528\uC758 \uB4F1\uC744 \uB54C\uB9AC\uAE30 \uC2DC\uC791\uD588\uB2E4",
